How do you use MongoDB $lookup to return a substring, then check things in another collection with that substring<p>I am trying to use the MongoDB Aggregation pipeline to pull items from one collection, check a string (a url), extract a substring from that, then check in a second collection for a matching document to said substring off one of the second collection document fields.</p>
<p>collection1 document:</p>
<pre><code>{
    _id: ObjectId('xxxxxxxxxxxxxxxxxxx'),
    url: 'https://example.com/WNE8UH'
}
</code></pre>
<p><em><strong>edit: The productId is not always located at the end of the url string.  Sometimes it's right in the middle, which forces me to extract it before any comparison step.</strong></em></p>
<p>collection2 document:</p>
<pre><code>{
    _id: ObjectId('xxxxxxxxxxxxxxxxxxx'),
    productId: 'WNE8UH'
}
</code></pre>
<p>See the <code>url</code> in collection1 contains <code>WNE8UH</code> which is <code>productId</code> in collection2?</p>
<p>How do you use aggregation to return the substring of <code>url</code>, then use <code>$lookup</code> to locate the document in collection2 <code>productId</code> field?</p>
<p>Here is my current code:</p>
<pre><code>db.collection1.aggregation([
    { $match: { url: RegExp( 'example.com', 'i' ) } },
    { $lookup: {
        from: 'collection2',

        let: {
            productId: { 
                $regexFind: { 
                    input: &quot;$url&quot;, 
                    regex: '(?&lt;=com\/)\w{6}'
             }
           }
        },
        pipeline: [
        {
            $match: { productId: '$$productId'
                }
        }
        ],
        as: 'matching_doc'

    }}
])
</code></pre>
<p>Result</p>
<pre><code>{
    _id: ObjectId('xxxxxxxxxxxxxxxxxxx'),
    url: 'https://example.com/WNE8UH',
    matching_doc: []
}
</code></pre>
<p>Getting empty array.  I need to get the matching doc.</p>
<p>What am I doing wrong?</p>

